/*Table structure for table `leave_person` */

DROP TABLE IF EXISTS `leave_person`;

CREATE TABLE `leave_person` (
  `levae_id` varchar(50) NOT NULL,
  `leave_admin_id` varchar(50) DEFAULT NULL COMMENT '请假人，用户表主键',
  `leave_reason` varchar(255) DEFAULT NULL COMMENT '请假原因',
  `leave_start_time` varchar(20) DEFAULT NULL COMMENT '请假开始时间',
  `leave_first_approval_desc` varchar(50) DEFAULT NULL COMMENT '第一审阅备注',
  `leave_second_approval_desc` varchar(50) DEFAULT NULL COMMENT '第二审阅备注',
  `leave_third_approval_desc` varchar(50) DEFAULT NULL COMMENT '第三审阅备注',
  `leave_second_approvel_status` char(2) DEFAULT NULL COMMENT '第二审阅状态 01：未审阅 00：已审阅',
  `leave_third_approvel_status` char(2) DEFAULT NULL COMMENT '第三审阅状态 01：未审阅 00：已审阅',
  `leave_first_approvel_status` char(2) DEFAULT NULL COMMENT '第一审阅状态 01：未审阅 00：已审阅',
  `leave_end_time` varchar(50) DEFAULT NULL COMMENT '请假结束时间',
  `leave_first_approvaler` varchar(50) DEFAULT NULL COMMENT '第一审阅人 用户表ID',
  `leave_second_approvaler` varchar(50) DEFAULT NULL COMMENT '第二审阅人',
  `leave_third_approvaler` varchar(50) DEFAULT NULL COMMENT '第三审阅人',
  `leave_approval_time` varchar(20) DEFAULT NULL COMMENT '审阅时间',
  `leave_num` float(8,1) DEFAULT NULL COMMENT '请假天数',
  `leave_num_desc` varchar(50) DEFAULT NULL COMMENT '请假天数描述',
  `leave_creatime` varchar(20) DEFAULT NULL COMMENT '请假申请提交时间',
  `leave_first_approval_res` char(2) DEFAULT NULL COMMENT '第一审阅结果 0：同意 1：拒绝',
  `leave_second_approval_res` char(2) DEFAULT NULL COMMENT '第二审阅结果 0：同意 1：拒绝',
  `leave_third_approval_res` char(2) DEFAULT NULL COMMENT '第三审阅结果 0：同意 1：拒绝',
  `leave_type` varchar(2) DEFAULT NULL COMMENT '请假类型',
  `leave_pass` varchar(2) DEFAULT NULL COMMENT '请假是否通过',
  `leave_pic` varchar(50) DEFAULT NULL COMMENT '附件',
  PRIMARY KEY (`levae_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 ROW_FORMAT=DYNAMIC;

