/*Table structure for table `sys_admin` */

DROP TABLE IF EXISTS `sys_admin`;

CREATE TABLE `sys_admin` (
  `ADMIN_ID` varchar(50) NOT NULL COMMENT '主键 id',
  `ADMIN_STAFF_NO` varchar(24) DEFAULT NULL COMMENT '员工编号',
  `ADMIN_ROLE_ID` varchar(50) DEFAULT NULL COMMENT '所属角色:平台角色表外键',
  `ADMIN_BRANCH_ID` varchar(20) DEFAULT NULL COMMENT '所属机构:机构表外键',
  `ADMIN_USERNAME` varchar(20) DEFAULT NULL COMMENT '登陆名',
  `ADMIN_PASSWORD` varchar(50) DEFAULT NULL COMMENT '登陆密码',
  `ADMIN_REALNAME` varchar(20) DEFAULT NULL COMMENT '真实姓名',
  `ADMIN_STATUS` varchar(10) DEFAULT NULL COMMENT '管理员状态:0：正常\r\n1：禁用\r\n2：冻结',
  `ADMIN_MARK` varchar(10) DEFAULT NULL COMMENT '强制修改密码标志:0：不强制修改\r\n1：强制修改',
  `ADMIN_PHONE` varchar(50) DEFAULT NULL COMMENT '手机号',
  `ADMIN_EMAIL` varchar(50) DEFAULT NULL COMMENT '邮箱',
  `ADMIN_ERRORTIMES` int(2) DEFAULT NULL COMMENT '密码错误次数:默认为0',
  `ADMIN_CREATETIME` varchar(30) DEFAULT NULL COMMENT '创建时间',
  `ADMIN_CREATEUSER` varchar(50) DEFAULT NULL COMMENT '创建人:平台管理员表外键',
  `ADMIN_UPDATETIME` varchar(30) DEFAULT NULL COMMENT '修改时间',
  `ADMIN_UPDATEUSER` varchar(50) DEFAULT NULL COMMENT '修改人:平台管理员表外键',
  `ADMIN_COUNTDAY` varchar(10) DEFAULT NULL,
  `admin_lieu_day` float(8,1) DEFAULT '0.0' COMMENT '剩余倒休天数',
  PRIMARY KEY (`ADMIN_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

