/*Table structure for table `sys_control` */

DROP TABLE IF EXISTS `sys_control`;

CREATE TABLE `sys_control` (
  `CONTROL_ID` varchar(50) NOT NULL COMMENT 'ID 主键，UUID',
  `CONTROL_ADMIN_ID` varchar(20) DEFAULT NULL COMMENT '登陆用户,平台管理员表外键',
  `CONTROL_SESSIONID` varchar(50) DEFAULT NULL COMMENT 'Session ID',
  `CONTROL_LOGINTIME` varchar(30) DEFAULT NULL COMMENT '登陆时间',
  PRIMARY KEY (`CONTROL_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

