/*Table structure for table `sys_login` */

DROP TABLE IF EXISTS `sys_login`;

CREATE TABLE `sys_login` (
  `LOGIN_ID` varchar(50) NOT NULL COMMENT 'ID 主键，UUID',
  `LOGIN_ADMIN_ID` varchar(50) DEFAULT NULL COMMENT '登陆用户:平台管理员表外键',
  `LOGIN_LAST_TIME` varchar(30) DEFAULT NULL COMMENT '上次登录时间',
  `LOGIN_TIME` varchar(30) DEFAULT NULL COMMENT '登陆时间',
  `LOGIN_IP` varchar(20) DEFAULT NULL COMMENT '登陆IP',
  PRIMARY KEY (`LOGIN_ID`)
