/*Table structure for table `table_salary` */

DROP TABLE IF EXISTS `table_salary`;

CREATE TABLE `table_salary` (
  `salary_id` varchar(64) NOT NULL COMMENT '薪资id',
  `salary_type` varchar(20) DEFAULT NULL COMMENT '薪资类型 0:试用 1：正式 2：兼职',
  `salary_staff_no` varchar(24) DEFAULT NULL COMMENT '员工编号',
  `salary_staff_name` varchar(32) DEFAULT NULL COMMENT '员工名称',
  `salary_staff_carno` varchar(20) DEFAULT NULL COMMENT '身份证号',
  `salary_bank_account` varchar(20) DEFAULT NULL COMMENT '银行账号',
  `salary_check_standard_day` double(12,2) DEFAULT NULL COMMENT '月标准天数',
  `salary_formal_day` double(12,2) DEFAULT NULL COMMENT '正式工天数',
  `salary_use_day` double(12,2) DEFAULT NULL COMMENT '试用工天',
  `salary_ycqts_day` double(12,2) DEFAULT NULL COMMENT '出勤天数',
  `salary_base_pay` double(12,2) DEFAULT NULL COMMENT '基本工资',
  `salary_merit_pay` double(12,2) DEFAULT NULL COMMENT '绩效工资',
  `salary_account` double(12,2) DEFAULT NULL COMMENT '工资总额',
  `salary_paid` double(12,2) DEFAULT NULL COMMENT '应发工资',
  `salary_other_add` double(12,2) DEFAULT NULL COMMENT '其他增发',
  `salary_sick_pay` double(12,2) DEFAULT NULL COMMENT '病假扣款',
  `salary_abs_pay` double(12,2) DEFAULT NULL COMMENT '事假扣款',
  `salary_other_pay` double(12,2) DEFAULT NULL COMMENT '其他扣款',
  `salary_sum_pay` double(12,2) DEFAULT NULL COMMENT '扣减合计',
  `salary_sum_account` double(12,2) DEFAULT NULL COMMENT '收入总额',
  `salary_security_base` double(12,2) DEFAULT NULL COMMENT '社保基数',
  `salary_fund_base` double(12,2) DEFAULT NULL COMMENT '公积金基数',
  `salaray_insurance` double(12,2) DEFAULT NULL COMMENT '养老保险',
  `salaray_unemployment` double(12,2) DEFAULT NULL COMMENT '失业保险',
  `salaray_medical_base` double(12,2) DEFAULT NULL COMMENT '基本医疗',
  `salaray_housing_fund` double(12,2) DEFAULT NULL COMMENT '住房公积金',
  `salaray_reduction_sum` double(12,2) DEFAULT NULL COMMENT '减发合计',
  `salaray_tax` double(12,2) DEFAULT NULL COMMENT '纳税所得',
  `salaray_tax_pay` double(12,2) DEFAULT NULL COMMENT '应扣税金',
  `salaray_payroll` double(12,2) DEFAULT NULL COMMENT '实发金额',
  `salaray_create_time` varchar(16) DEFAULT NULL COMMENT '创建时间',
  `salaray_payroll_period_month` varchar(12) DEFAULT NULL COMMENT '工资所属月份',
