/*Table structure for table `table_ticket` */

DROP TABLE IF EXISTS `table_ticket`;

CREATE TABLE `table_ticket` (
  `ticket_id` varchar(64) NOT NULL COMMENT '报销单号（主键）',
  `ticket_time` varchar(20) NOT NULL COMMENT '报销详细时间',
  `ticket_item` varchar(1500) NOT NULL COMMENT '报销事项',
  `ticket_use` varchar(1500) NOT NULL COMMENT '报销用途',
  `ticket_pay` double(12,2) NOT NULL COMMENT '报销金额',
  `ticket_person` varchar(64) NOT NULL COMMENT '出资人',
  `ticket_type` varchar(20) NOT NULL COMMENT '发票情况',
  `ticket_remaker` varchar(500) NOT NULL COMMENT '备注',
  `ticket_create` varchar(20) NOT NULL COMMENT '创建时间',
  `ticket_month` varchar(50) DEFAULT NULL COMMENT '报销月份',
  `ticket_create_admin` varchar(50) DEFAULT NULL COMMENT '创建人',
  PRIMARY KEY (`ticket_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

